import "../styles/Home.scss";
import { ReactComponent as download } from "../assets/icon/Download-icon.svg";
import { ReactComponent as device } from "../assets/icon/Cardiogram-icon.svg";
import { ReactComponent as notification } from "../assets/icon/Notification-icon.svg";

class Home extends Component {


  render() {

    const Columns = () => 
    <div style={{ display: "grid", gridTemplateColumns: "repeat(3, 1fr)", gridGap: 20 }}>
      <div>Column 1</div>
      <div>Column 2</div>
      <div>Column 3</div>
    </div>

  return (
    <div id="home">
      <h1>Discover <span>safer</span> medical devices.</h1>
      <Columns />
    </div>
  );
  }
}

export default Home;
